INSERT INTO `reviews` (`id`, `name`, `comment`, `rating`, `is_price_correct`, `is_delivery_in_time`, `date`, `visibility`, `order`) VALUES
(16, 'Татьяна', 'Отличный магазин с шикарным сервисом и качественным товаром! Рекомендую!', 5, 1, 1, 1425333600, 1, 0),
(17, 'Ольга', 'Замечательный сервис! Девочки умнички! Камни отличного качества!!!', 5, 0, 1, 1428008400, 1, 0),
(18, 'Оксана', 'Дуже задоволена магазином і продавцем,всі замовлення оброблені швидко і відповідально.Приємних Вам покупців', 5, 1, 1, 1428391765, 1, 0),
(19, 'Александр', 'Заказывал стразы кристалин для инкрустации мебели, все понравилось, спасибо!', 5, 0, 0, 1428354000, 1, 0),
(20, 'Наталія', 'Замовляла кілька разів стрази) Дуже задоволена!!! Компетентні та високопрофесійні консультанти! Приємні до розмови, уважні до замовника! Якість страз хороша, я задоволена! Замовлення виконано у призначені строки! Було дуже приємно співпрацювати) Хай вам щастить! Особлива вдячність консультанту Ірині!!!', 5, 1, 1, 1428440400, 1, 0),
(22, 'таня', 'сегодня получила посылку стразы очень красивые магазин супер', 5, 1, 1, 1428526800, 1, 0),
(23, '', 'Супер! Очень быстро и качественно', 5, 1, 1, 1428699600, 1, 0),
(26, 'Смирнова Ольга', 'Заказывала стразы дочке на выпускное платье. Все очень понравилось, стразы хорошего качества, красиво блестят. Спасибо менеджеру Ирине за полезные советы и помощь в выборе.', 5, 1, 1, 1430341200, 1, 0),
(27, 'Давиденко Алена Николаевна', 'Очень радует заказывать у Вас стразы. Приятно, что у вас и подскажут, и посоветуют. Заказ всегда получала в самые краткие строки. Спасибо)', 4, 1, 1, 1430859600, 1, 0),
(28, 'Коваленко Марина', 'Заказывала пришивные камни и полужемчуг. Вся продукция соответствует описанию.', 4, 1, 1, 1430859600, 1, 0),
(29, 'Козак Тетяна', 'Дякую вам за продукцію і обслуговування.все дуже добре .донька дуже задоволена.', 5, 1, 1, 1430946000, 1, 0),
(30, 'Пронина Ольга', 'Спасибо компании Crystalline за качественную работу. Все заказы были выполнены в оговоренные сроки, камни целые, без повреждения,пришли быстро. Приятно работать.', 5, 1, 1, 1431291600, 1, 0),
(31, 'Вера', 'Заказывала стразы, качество обслужевания на высшем уровне , заказ получила очень быстро, !!! Спасибо большое !!!', 5, 1, 1, 1431291600, 1, 0),
(32, 'Лариса', 'Покупаю стразы в этом магазине не первый раз, качество хорошее, приятно радует система скидок. Спасибо!', 5, 1, 1, 1431637200, 1, 0),
(33, 'Юрий', 'Товар соответствует описанию, быстрая доставка', 4, 1, 1, 1431723600, 1, 0),
(34, '', 'Все честно и оперативно! Спасибо за работу!', 5, 0, 0, 1431723600, 1, 0),
(35, 'Карина Тарасова', 'Хорошие консультанты, все объяснили и рассказали. Заказывала стразы первый раз, заказом осталась довольна. Спасибо за помощь!', 5, 2, 2, 1431723600, 1, 0),
(36, 'Спивак Виктория', 'Внимание к клиенту, скорость выполнения заказа, соотношение цена/качество - все на высшем уровне. Очень довольна сотрудничеством с этим магазином.', 5, 1, 1, 1431810000, 1, 0),
(37, 'Анна Галецкая', 'Заказ был оформлен очень быстро. Качество страз замечательное, теперь не виду смысла даже покупать Сваровски) Клей держит прекрасно!', 5, 2, 2, 1431896400, 1, 0),
(38, 'Юлия', 'Заказ был выполнен и доставлен быстрее чем я ожидала, работа компании очень хорошая. Качество камней отличное, я брала сыну на танцевальный костюм, клеила сама, клей очень хороший, выступал в костюме уже пять раз не один камень еще не отпал. Сияют также, как и сваровских, разницу никто не заметил, мне очень нравится, буду теперь брать только такие и только в этой компании. Спасибо', 5, 1, 1, 1431982800, 1, 0),
(39, 'Тамара Алексеенко', 'Сегодня получила свой заказ, по рекомендации менеджера взяла стразы Crystalline, качеством страз осталась очень довольна! Спасибо, рекомендую! С ув. Тамара', 5, 1, 1, 1432155600, 1, 0),
(40, '', 'Все соответствует описанию', 5, 1, 1, 1432155600, 1, 0),
(41, '', 'При получении посылки, обнаружила, что не хватает клея. Связавшись с менеджером. вопрос был решен, мне отправили недостающий клей, затраты по доставке были оплачены магазином. Камни хорошего качества, буду заказывать еще.', 3, 0, 0, 1432155600, 1, 0),
(42, 'Анжела', 'Спасибо за отличное обслуживание и качественную продукцию!!!', 5, 2, 2, 1432501200, 1, 0),
(43, 'Юлия', 'Понравилась работа магазина, быстрая реакция на заявочку, спасибо огромное! Успеха и процветания Вам!', 5, 1, 1, 1432674000, 1, 0),
(44, 'Анастасия', 'Покупала стразы "Crystalline", "DMC+" не первый раз в этом чудесном онлайн-магазине, хорошее качество страз, быстрая доставка. Всегда приветливые консультанты. Приятно работать с таким магазином. Всем советую!!!!', 5, 1, 1, 1433254363, 1, 0),
(45, 'Елена (Бердянск)', 'Молодцы! Сделала заказ, на следующий день уже получила. Качество очень хорошо. Спасибо.', 5, 2, 2, 1434661200, 1, 0),
(46, 'Marina', 'Заказывала искусственный жемчуг и клей. Отличное качество, без заусенец, очень здорово клеится на ткань, быстро схватывается, бусины ложатся ровно, как под линейку. Свадебное платье было спасено, невеста была в восторге. Спасибо:)', 5, 2, 2, 1435179600, 1, 0),
(47, 'Захарченко Марина', 'Уже как два года работаю с этим магазином и получаю только положительные эмоции. Вежливые менеджеры, всегда дадут дельный совет. Качество товара очень хорошее, постоянно использую стразы в своей работе, есть с чем сравнивать. Быстрая доставка! Одним словом РЕКОМЕНДУЮ! Спасибо!', 5, 1, 1, 1438203600, 1, 0),
(48, 'Лариса', 'Покупали стразы для свадебного платья дочки. Хороший сервис, качественный товар! Рекомендую', 5, 2, 2, 1439845200, 1, 0),
(49, 'Мария', 'Спасибо большое! Заказ пришёл очень быстро.И отдельное спасибо за подарочек!', 5, 2, 2, 1439845200, 1, 0),
(50, 'Анастасия', 'При первом заказе все очень понравилось!Вежливые продавцы ,хорошо все объяснили,заказ пришло вовремя с приятным подарочко!Но через два дня при повторном заказе это был ужас !!!Посылку прислали не на то имя ,телефон указали неверно!Я целый день порождала посылку которая уже давно пришла!Прийдя на почту мне сказали что через 15 минут не больше!!!!я получу посылку!В итоге я больше часа прождала на жаре свою посылку в обещаньях!А у меня завтра свадьба,я вся на нервах,мне каждая секунда дорога!Очень', 3, 2, 2, 1440709200, 1, 0),
(51, 'Юлия', 'По рекомендации менеджера взяла стразы кристаллайн, я в восторге! Стразы-супер! Нашла для себя хорошую альтернативу стразам сваровски. Рекомендую! Так же хочу сказать, что в магазине работают отличные менеджеры, девочки спасибо за терпение и помощь!', 5, 2, 2, 1442264400, 1, 0),
(52, 'Елена', 'положительные впечатления, менеджер связалась сразу после оформления заказа, отправили оперативно, получила заказ на следующий день. заказывала пришивные стразы crystalline, качество вполне приемлемое. спасибо за подарок, очень приятно!', 5, 2, 2, 1442523600, 1, 0),
(53, 'Захарченко Татьяна', 'Заказывали украшение на шею под стандартное платье. Это произведение искусства, очень красивое). Спасибо!', 5, 1, 1, 1443473284, 1, 0),
(54, 'Анастасия', 'Заказываю не первый раз, очень довольна и качеством товаров, и сервисом. Менеджер всегда в тот же день перезванивает для уточнения заказа, посылку получаю уже на следующий день после оплаты. Рекомендую!', 5, 1, 1, 1443560400, 1, 0),
(55, 'Смирнова Виктория Александровна', 'Спасибо, не ожидала!!! Очень довольна...', 5, 2, 2, 1444683600, 1, 0);
